常用元字符</span></td></tr><tr class="l"><td width="60px">.</td><td class="desc">匹配除换行符以外的任意字符</td></tr><tr class="l"><td>\w</td><td class="desc">匹配字母或数字或下划线或汉字</td></tr><tr class="l"><td>\s</td><td class="desc">匹配任意的空白符</td></tr><tr class="l"><td>\d</td><td class="desc">匹配数字</td></tr><tr class="l"><td>\b</td><td class="desc">匹配单词的开始或结束</td></tr><tr class="l"><td>^</td><td class="desc">匹配字符串的开始</td></tr><tr class="l"><td>$</td><td class="desc">匹配字符串的结束</td></tr><tr class="t"><td colspan="2"style="padding:5px;"><span style="font-weight:bold;color:Red;">常用限定符</span></td></tr><tr class="l"><td>*</td><td class="desc">重复零次或更多次</td></tr><tr class="l"><td>+</td><td class="desc">重复一次或更多次</td></tr><tr class="l"><td>?</td><td class="desc">重复零次或一次</td></tr><tr class="l"><td>{n}</td><td class="desc">重复n次</td></tr><tr class="l"><td>{n,}</td><td class="desc">重复n次或更多次</td></tr><tr class="l"><td>{n,m}</td><td class="desc">重复n到m次</td></tr><tr class="t"><td colspan="2"style="padding:5px;"><span style=" font-weight:bold; color:Red;">常用反义词</span></td></tr><tr class="l"><td>\W</td><td class="desc">匹配任意不是字母，数字，下划线，汉字的字符</td></tr><tr class="l"><td>\S</td><td class="desc">匹配任意不是空白符的字符</td></tr><tr class="l"><td>\D</td><td class="desc">匹配任意非数字的字符</td></tr><tr class="l"><td>\B</td><td class="desc">匹配不是单词开头或结束的位置</td></tr><tr class="l"><td>[^x]</td><td class="desc">匹配除了x以外的任意字符</td></tr><tr class="l"><td>[^aeiou]</td><td class="desc">匹配除了aeiou这几个字母以外的任意字符</td></tr><tr><td colspan="2"style="padding:10px;background-color:#FFFFFF;"><a href="//hechaocheng.cn/study-regex-expressions/"target="_blank"style="color:blue">查看正则表达式教程</a></td></tr></tbody></table></div>友情链接：
